import "./Footer.css"

export const Footer = () => {

    return (
        <div className="socials">
            <div className="logos">
                <a href="https://www.instagram.com/fatbacksound/" target="_blank"><img src="https://res.cloudinary.com/dgwi6xvfl/image/upload/v1671822675/FatBack/instagram_logo_ec0ghm.png" alt="instagram logo" className="logo"/></a>
                <a href="https://www.facebook.com/FatbackSound" target="_blank"><img src="https://res.cloudinary.com/dgwi6xvfl/image/upload/v1671822675/FatBack/facebook_logo_xwzqpd.png" alt="facebook logo" className="logo"/></a>
                <a href="https://open.spotify.com/playlist/7qi70oRnHLGZINS5cq3sEZ" target="_blank"><img src="https://res.cloudinary.com/dgwi6xvfl/image/upload/v1671826183/FatBack/spotify_xios71.png" alt="spotify logo" className="logo"/></a>
            </div>
        </div>
    )
}
